import React from "react";
import "./Setting_up.css";
import deski_ash from "../assets/deski_ash.svg";
import { Pane, TextInput, Button } from "evergreen-ui";

function Setting_up() {
    return (
        <div>
            <div className="settig_up">
                <img src={deski_ash} alt="" className="settig_up_logo" height="80" width="120" />
            </div>
            <div className="settig_up">
                <Pane className="settig_up_pane">
                    <h1>Let's get started</h1>
                    <h4>Give your site a name</h4>
                    <p>Choose something familiar like your team and company</p>
                    <TextInput
                        width={322}
                        backgroundColor="rgb(247, 245, 245)"
                        className="settig_up_inputfield"
                        placeholder="Your-site-name                                                   .deski.app"
                    />
                    <Button width={322} backgroundColor="rgb(247, 245, 245)" border="none" className="setting_up_button">
                        Continue
                    </Button>
                </Pane>
            </div>
        </div>
    );
}

export default Setting_up;
